        /// <returns>The value in the base unit representation.</returns>
        private QuantityValue AsBaseUnit()
        {
            switch(Unit)
            {
                case ElectricLinearResistivityUnit.KiloohmPerCentimeter: return (_value / 100) * 1e3d;
                case ElectricLinearResistivityUnit.KiloohmPerFoot: return (_value / 3.2808398950131234) * 1e3d;
                case ElectricLinearResistivityUnit.KiloohmPerKilometer: return (_value * 1000) * 1e3d;
                case ElectricLinearResistivityUnit.KiloohmPerMeter: return (_value) * 1e3d;
                case ElectricLinearResistivityUnit.KiloohmPerMile: return (_value * 1609) * 1e3d;
